// frontend/src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import axios from 'axios';

// Import components
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import Dashboard from './components/dashboard/Dashboard';
import Equipment from './components/equipment/Equipment';
import Maintenance from './components/maintenance/Maintenance';
import SchedulePreventive from './components/maintenance/SchedulePreventive';
import ReportIssue from './components/maintenance/ReportIssue';
import Tasks from './components/tasks/Tasks';
import Users from './components/users/Users';
import AddEquipment from './components/equipment/AddEquipment';
import AddTask from './components/tasks/AddTask';
import AddUser from './components/users/AddUser';
import Navbar from './components/layout/Navbar';
import Sidebar from './components/layout/Sidebar';
import PrivateRoute from './components/routing/PrivateRoute';

// Axios base settings
axios.defaults.baseURL = 'http://localhost:5000/api';
axios.defaults.withCredentials = true;

// Axios interceptors for auth and debug
axios.interceptors.request.use(
  request => {
    const token = localStorage.getItem('token');
    if (token) {
      request.headers['Authorization'] = `Bearer ${token}`;
    }
    return request;
  },
  error => Promise.reject(error)
);

axios.interceptors.response.use(
  response => response,
  error => {
    if (error.response?.status === 401) {
      localStorage.removeItem('token');
      window.location.href = '/login';
    }
    return Promise.reject(error);
  }
);

function App() {
  const [user, setUser] = useState(null);
  const [currentPage, setCurrentPage] = useState('dashboard');
  const [loading, setLoading] = useState(true);
  const [redirectPath, setRedirectPath] = useState('/dashboard'); // Default

  // Preserve last attempted path
  const location = useLocation();
  useEffect(() => {
    if (!user && location.pathname !== '/login' && location.pathname !== '/register') {
      setRedirectPath(location.pathname);
    }
  }, [location, user]);

  // Check authentication on mount
  useEffect(() => {
    const initializeAuth = async () => {
      const token = localStorage.getItem('token');
      if (token) {
        try {
          const config = { headers: { Authorization: `Bearer ${token}` } };
          const res = await axios.get('/auth/me', config);
          if (res.data && res.data.user) {
            setUser(res.data.user);
          } else {
            localStorage.removeItem('token');
          }
        } catch {
          localStorage.removeItem('token');
        }
      }
      setLoading(false);
    };
    initializeAuth();
  }, []);

  // Login function
  const login = (userData) => {
    if (userData && userData.token && userData.user) {
      localStorage.setItem('token', userData.token);
      setUser(userData.user);
      axios.defaults.headers.common['Authorization'] = `Bearer ${userData.token}`;
    }
  };

  // Logout function
  const logout = () => {
    setUser(null);
    localStorage.removeItem('token');
    delete axios.defaults.headers.common['Authorization'];
    window.location.href = '/login';
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-teal-500 to-teal-700">
        <div className="text-center">
          <div className="inline-block h-8 w-8 animate-spin rounded-full border-4 border-white border-r-transparent"></div>
          <p className="mt-4 text-white text-lg font-semibold">Loading application...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="h-screen flex bg-gray-50">
      {user && <Sidebar currentPage={currentPage} />}
      <div className={user ? "flex-1 flex flex-col overflow-hidden" : "w-full"}>
        {user && <Navbar user={user} logout={logout} />}
        <main className="flex-1 overflow-x-hidden overflow-y-auto bg-gray-50">
          <div className="container mx-auto px-6 py-8">
            <Routes>
              {/* Public routes */}
              <Route
                path="/login"
                element={!user ? <Login login={login} /> : <Navigate to={redirectPath} replace />}
              />
              <Route
                path="/register"
                element={!user ? <Register login={login} /> : <Navigate to={redirectPath} replace />}
              />

              {/* Default route */}
              <Route
                path="/"
                element={user ? <Navigate to={redirectPath} replace /> : <Navigate to="/login" replace />}
              />

              {/* Protected routes */}
              <Route path="/dashboard" element={<PrivateRoute user={user}><Dashboard user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/equipment" element={<PrivateRoute user={user}><Equipment user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/add-equipment" element={<PrivateRoute user={user}><AddEquipment user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/maintenance" element={<PrivateRoute user={user}><Maintenance user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/schedule-preventive" element={<PrivateRoute user={user} role="Engineer"><SchedulePreventive user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/report-issue" element={<PrivateRoute user={user}><ReportIssue user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/tasks" element={<PrivateRoute user={user}><Tasks user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/add-task" element={<PrivateRoute user={user}><AddTask user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/users" element={<PrivateRoute user={user} role="Engineer"><Users user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />
              <Route path="/add-user" element={<PrivateRoute user={user} role="Engineer"><AddUser user={user} setCurrentPage={setCurrentPage} /></PrivateRoute>} />

              {/* Fallback */}
              <Route path="*" element={<Navigate to={user ? redirectPath : "/login"} replace />} />
            </Routes>
          </div>
        </main>
      </div>
    </div>
  );
}

// Wrap App with Router so useLocation works
export default function AppWithRouter() {
  return (
    <Router>
      <App />
    </Router>
  );
}
